import React from 'react'

const Photos = ({artWorks}) => {
  return (
    <div className="thumbnails row">
        { artWorks && artWorks.map(art => {
          return (
            <div className="col l4 m4 s4">
              <img
                src={art.imageUrl}
                alt="x"
                className="responsive-img" />
            </div>
          )
        })}
    </div>
  )
}

export default Photos
